import React from "react";
import ProjectCard from "../../components/ProjectCard";
import projects from "../../projects.json";
// import "./App.css";
import { Col, Row, Container, Wrapper } from "../../components/Grid";
import "./Projects.css"
import Nav from "../../components/Nav/"

class Projects extends React.Component {
  // Setting this.state.friends to the friends json array
  constructor(props) {
    super(props);
    this.state = {
      projects
    };
  }

  
  // Map over this.state.friends and render a FriendCard component for each friend object
  render() {
    return (
      <Container   style={{ background: "green" }} fluid>
      <Nav/>
      <div id={"projectContainer"}>
          <Row>
        <Col className="projectRow" style={{display: "inline-block"}}
        size="md-6  sm-12">
                
          <ProjectCard
            id={projects[0].id}
            key={projects[0].id}
            title={projects[0].title}
            image={projects[0].image}
            description={projects[0].description}
            url={projects[0].url}
          />
        </Col>        

        <Col size="md-6  sm-12">
        <div style={{display: "inline-block"}}><p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus feugiat odio dui, vel scelerisque lorem faucibus sit amet. Fusce sem dolor, d</p></div> </Col>  
          
       
        
        
        </Row>
        </div>
      </Container>
    );
  }
}

export default Projects;
